css:
@-moz-document url-prefix("https://jscalc.io/") {
#inputs, #outputs, #cheat-sheet, #link, #embed {
    background-color: #111111;
}

.title-row .title {
    display: inline-block;
    margin-right: 26px;
    color: rgb(118, 118, 118);
    font-weight: 500;
}

md-input-container .md-input {
    color: rgba(150, 150, 150, 1);
    border-color: rgb(59, 59, 59);
}

md-input-container:not(.md-input-invalid).md-input-focused .md-input {
    border-color: #356289;
} 

html, body {
    height: 100%;
    color: rgba(150, 150, 150, 1);
    background: #111111;
    position: relative;
}

#inputs .frame-title, #outputs .frame-title, #cheat-sheet .frame-title, #link .frame-title, #embed .frame-title {
    color: rgb(150, 150, 150);
}

.table-output-container th {
    color: rgb(150, 150, 150);
    font-weight: 500;
    font-size: 12px;
    vertical-align: bottom;
    border-bottom: 2px solid #356289;
    border-top: 0;
}

.table-output-container th, .table-output-container td {
    text-align: left;
    padding: 8px;
    line-height: 1.42857143;
    vertical-align: top;
    border-top: 1px solid #666;
}

.published-aside {
    background-color: #152635 !important;
    color: #999;
    overflow: auto;
}

md-select-value#select_value_label_0.md-select-value {
    color: rgb(150, 150, 150);
    border-color: #356289
}
}
